import React from "react";
import "../../Assets/Paciente/Login.css";
// import { CheckCircle, ArrowRight} from 'react-bootstrap-icons'
import {Link} from 'react-router-dom'


export default class InputColegiado extends React.Component {
    state = {
    value: ''
  }
  handleSubmit = e => {
    e.preventDefault();
    this.setState({ value: this.refs.textInput.value})
  };

  render() {
    return (
      <div>
        <form onSubmit={this.handleSubmit}>
          <input 
            className="form-control"
            placeholder="Introduzca su número de colegiado"
            pattern="[0-9]{9}" 
            title="Debe poner 9 números"
            type="text" ref="textInput" />
          <input 
            className="form-control mt-2"
            placeholder="Introduzca su contraseña"
            type="password"  />
        </form>
       
        <button className="btn btn-success btn-lg m-2">
          Verificar        
        </button>

        <Link 
          className="btn btn-success btn-lg m-2"
          to="{this.state.value}">
          ENTRAR                            
        </Link>   
      </div>
    );
  }
}
